  [],\n\t\"revision_timestamp\": \"2016-10-15T16:36:09.177933\",\n\t\"name\": \"mason-neck-national-wildlife-refuge-narrative-report-fy-1974\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Mason
  Neck National Wildlife Refuge outlines Refuge accomplishments during the 1974 fiscal
  year. The report begins by summarizing the weather conditions, habitat conditions,
  water conditions, and food and cover conditions during the year. Wildlife- including
  migratory birds, upland game birds, big game animals, furbearers, predators, rodents,
  mammals, raptors, reptiles, and disease- is also covered. A progress report on field
  investigation or applied research is included. The public relations section of the
  report describes recreational uses, Refuge visitors, Refuge participation, hunting,
  and safety. Photographs are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
